import { useState } from 'react';
import '../style.less'
function Header() {
  const [current, setcurrent] = useState(1)
  const [navList, setNavList] = useState([
    { code: 1, name: '官网首页' },
    { code: 2, name: '案例展示' },
    { code: 3, name: '关于我们' },
    { code: 4, name: '联系我们' },
  ])
  return (
    <div id='header'>
      <div className='title'>
        <span>领业装饰</span>
        <span>LINGYEZHUANGSHI</span>
      </div>
      <div className='nav'>
        <span >官网首页</span>
        <span>案例展示</span>
        <span>关于我们</span>
        <span>联系我们</span>
      </div>
    </div>
  )
}
export default Header;
